import React from "react";
import { useNavigate } from "react-router-dom";
import Header from "./header";
import SubHeder from "./subHeader";
import Footer from "./footer";
import { Button } from "antd";
import landingMainImage from "./images/landing-page-main-img.png";
import landingStarImage from "./images/landing-page-star-img.png";

import "./index.css";
import "./App.css";

function App() {
  const navigate = useNavigate();
  const handleClick = () => {
    navigate("/path/to/push");
  };
  return (
    <>
      <Header />
      <SubHeder />
      <img src={landingMainImage} className="landing-main-img" alt="mainimg" />
      <div className="welcome-div">
        <p className="welcome-paragraph">
          WELCOME TO
          <br />
          <br />
          YOUR JOURNEY THROUGH
          <br />
          <br />
          CUSTOMER EXPERIENCE
        </p>
        <button onClick={handleClick} className="landing-button">
          Be part of the conversation
        </button>
        <h4 className="head-4">LEARN MORE</h4>
      </div>
      <div
        className="landing-star-img-div"
        style={{ backgroundImage: `url(${landingStarImage})` }}
      >
        {/* <img
          src={landingStarImage}
          className="landing-star-img"
          alt="starimg"
        /> */}
        <Footer />
      </div>
    </>
  );
}

export default App;
